import React, { useState, useEffect } from 'react';
import Button from '@mui/material/Button';
import Grid from '@mui/material/Grid';
import EastIcon from '@mui/icons-material/East';
import { EmployerSubscriptionTrail } from '../../../sevices/account';
import { Spin } from 'antd';
import { useNavigate } from "react-router-dom";
import { ENV_CONFIG } from '../../../constant';

const SubscriptionPlans = (props) => {
    const { companyDetails } = props
    const [loading, setLoading] = useState(false);
    const [payment, setPayment] = useState('');
    const [subscriptionPlan, setsubscriptionPlan] = useState('')

    const stripe = require('stripe')(ENV_CONFIG.STRIPE_KEY);
    const { onBack } = props;
    const navigate = useNavigate();
    // const history = useHistory();
    let loaclInfo = localStorage.getItem("generalInfo")

    const Onsubmit = async () => {
        const body = {}
        body.email = companyDetails.email
        try {
            const response = await EmployerSubscriptionTrail(body);
            if (response.status === 200) {
                const URL = response.data.details.url
                window.location.href = URL;
            }
        } catch (error) {
            console.error('Subscription error:', error);
        }
    }

    useEffect(() => {
        priceView()

    }, [])

    const priceView = async () => {
        const productKey = ENV_CONFIG.EMPLOYER_PRODUCT_KEY;
        try {
            const product = await stripe.products.retrieve(productKey);
            if (product) {
                setsubscriptionPlan(product?.name)
                const priceid = product?.default_price
                const priceDetails = await stripe.prices.retrieve(priceid);
                setPayment(priceDetails?.unit_amount)
            }
        } catch (error) {
            console.error('Error retrieving product:', error);
        }
    }


    return (
        <div className="WizardSubscriptionPlan">
            <div className="title">Subscription Plan</div>
            <div className="WizardSubscriptionContainer">
                <Spin spinning={loading}>
                    <div className="WizardSubscriptionTitle">
                        {subscriptionPlan} <strong>₹{payment / 100} / year</strong> and the benefits are:
                    </div>
                    <Grid container spacing={2.5}>
                        <Grid item xs={12} sm={4}>
                            <div className="WizardSubscriptionCard">
                                <div className="SubscriptionCardTitle">
                                    Unlimited Resumes and Social profile search
                                </div>
                                <div className="SubscriptionCardContent">
                                    Search and Contact over 80 thousand candidates
                                    in Part timer Resume Database
                                </div>
                            </div>
                        </Grid>
                        <Grid item xs={12} sm={4}>
                            <div className="WizardSubscriptionCard">
                                <div className="SubscriptionCardTitle">
                                    Unlimited Resume match notification
                                </div>
                                <div className="SubscriptionCardContent">
                                    Receive instant notifications when new resumes
                                    are added that match your search criteria.
                                </div>
                            </div>
                        </Grid>
                        <Grid item xs={12} sm={4}>
                            <div className="WizardSubscriptionCard">
                                <div className="SubscriptionCardTitle">
                                    Job post Email
                                </div>
                                <div className="SubscriptionCardContent">
                                    Job Boost automatically sends targeted emails only to
                                    candidates who match your job description, saving you
                                    time and greatly increasing performance.
                                </div>
                            </div>
                        </Grid>
                    </Grid>
                    <div className="SubscriptionWizardBtn">
                        <Button onClick={Onsubmit} variant="contained" color="primary" className="SubscriptionBtn">
                            <span>Subscribe now</span>
                            <EastIcon />

                        </Button>



                    </div>
                </Spin>
            </div>
        </div>
    );
}

export default SubscriptionPlans;
